import './App.css';

import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import ListEmployeeComponent from './components/Livro/ListEmployeeComponent';

function App() {
  return (
    <div>
    <Router>

      <div className="container">

        <Routes>
          <Route path="/" element={<ListEmployeeComponent />} />

        </Routes>

      </div>
    </Router>
  </div >
  );
}

export default App;
